func NewCoinmate(userConfig map[string]interface{}) *Coinmate {
	p := NewCoinmateCore()
	p.Init(userConfig)
	return &Coinmate{
		CoinmateCore:  p,
		Core:          p,
		exchangeTyped: NewExchangeTyped(&p.Exchange),
	}
}
func NewCoinmateFromCore(core *CoinmateCore) *Coinmate {
	return &Coinmate{
		CoinmateCore:  core,
		Core:          core,
		exchangeTyped: NewExchangeTyped(&core.Exchange),
	}
}

